import { makeStyles } from "@material-ui/core/styles";

export default makeStyles((theme) => ({
	container: {
		display: "flex",
		justifyContent: "center",
		paddingLeft: 30,
		paddingRight: 30,
	},
	button_root: {
		width: "100%",
		background: "#222258",
	},
}));
